script:
reset();

const size = { x: 32, y: 16, z: 128 };
const origin = { x: size.x * -0.5, y: 0, z: size.z * -0.5 };

for (let x = 0; x < size.x; x += 1) {
  for (let y = 0; y < size.y; y += 1) {
    for (let z = 0; z < size.z; z += 1) {
      const isEdge = (
        (
          (z < 6 || z > size.z - 7)
          && y < 6
        )
        || z === 0
        || z === size.z - 1
      );
      if (
        y === 0
        || isEdge
        || x < 1
        || x > size.x - 2
      ) {
	    update(
          origin.x + x, origin.y + y, origin.z + z,
          y === 0 && !isEdge ? 4 : 1
        );
      }
    }
  }
}

box(
  origin.x + size.x  * 0.5 - 4, origin.y + 5, origin.z + size.z * 0.5 - 4,
  8, 1, 8,
  1
);

const elevators = [
  {
    x: -4,
    y: 6,
    z: size.z * 0.5 - 1,
    r: 0
  },
  {
    x: -4,
    y: 6,
    z: size.z * -0.5 - 7,
    r: 1
  }
];
elevators.forEach(({ x, y, z, r }) => {
  box(
    x, y - 6, z,
    8, 13, 8,
    1
  );
  box(
    x + 1, y - 1, z + 1,
    6, 7, 6,
    3
  );
  box(
    x + 2, y, z + 2,
    4, 5, 4,
    0
  );
  box(
    x + 2, y, z + (r === 0 ? -1 : 8),
    4, 5, 1,
    2
  );
  box(
    x + 3, y, z + (r === 0 ? -1 : 6),
    2, 4, 3,
    0
  );
  box(
    x + 1, y, z + (r === 0 ? -2 : 9),
    6, 4, 1,
    0
  );
});
